import { useState } from "react";
function Table({ data }) {
    console.log(data);
    const [column,setColumn]=useState(['id','title','description','price','discountPercentage','rating','stock','brand','category']);
    return (
      <div>
        {data ? (
          <table>
            <thead>
              <tr>
                {column?.map((item)=>(
                    <th>{item}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {data?.map((item) => (
                <tr key={item.id}>
                  <td>{item.id}</td>
                  <td>{item.login}</td>
                  <td>
                    <a href={item.html_url} target="_blank" rel="noopener noreferrer">
                      {item.html_url}
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Loading...</p>
        )}
      </div>
    );
  }

  export default Table;
